import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

import Header                   from './../../components/Header';
import Footer                   from './../../components/Footer';

class Home extends Component {
  render() {
    return (
      <div>

        <Header />

          <div className="container-page hidden">

            <div data-text>

              <p data-title>Um <b>fundo de capital de Risco</b> que vale por uma carteira inteira</p>
              <p data-description>
                Um fundo de capital de Risco que vale por uma carteira inteira asdas as das dasdasd asdas as dsaas as as sadasd as ds
              </p>

              <div>
                <button data-colored="big">Criar minha conta</button>
                <button data-glass="big">Criar minha conta</button>
              </div>

            </div>

            <i data-image></i>

            <div>

              <div>
                <i data-icon></i>
                <p data-title>i asodoasdj oasi doas jdaosidjoda</p>
                <p data-description>
                  i asodoasdj oasi doas jdaosidjoda as i asodoasdj oasi doas jdaosidjoda as i asodoasdj oasi doas jdaosidjoda as 
                </p>
              </div>

            </div>

          </div>

        <Footer />

      </div>
    );
  }
}
export default Home;
